Jūsų Zigbee adapterio tinklo nustatymai nesuderinami su naujausia tinklo atsargine kopija. Taip dažniausiai nutinka, jei juos perrašė kita Zigbee integracija (pvz., Zigbee2MQTT arba deCONZ). 

 {diff} 

 Jei tyčia nepakeitėte tinklo nustatymų, atkurkite juos iš naujausios atsarginės kopijos: kitaip jūsų įrenginiai neveiks.
